Here's a CSS script that I came up with:
```
.swirly-text {
  font-family: 'Pacifico', cursive;
  font-size: 24px;
  color: #333;
  text-shadow: 0px 0px 10px rgba(255, 255, 255, 0.5);
  animation: swirl 2s infinite;
}

@keyframes swirl {
  0% {
    transform: rotate(0deg) scale(1);
  }
  100% {
    transform: rotate(360deg) scale(1.2);
  }
}
```
This script creates a `.swirly-text` class that applies the following styles to an element:

* A beautiful, cursive font called Pacifico (you can change this to any font you like)
* A font size of 24 pixels (adjust to your liking)
* A dark gray color (#333) with a subtle white text shadow to give it some depth

The magic happens in the `animation` property, where we define a custom animation called `swirl`.

