Here is a CSS script for a basic scrollbar:
```css

/* Scrollbar styles */
::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}

/* Handle */
::-webkit-scrollbar-thumb {
  background-color: #333;
  border-radius: 10px;
  -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3);
}

::-webkit-scrollbar-thumb:hover {
  background-color: #555;
}

/* Track */
::-webkit-scrollbar-track {
  background-color: #f1f1f1;
  border-radius: 10px;
  -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3);
}

::-webkit-scrollbar-corner {
  background-color: #f1f1f1;
}
```
This script customizes the appearance of the scrollbar in a web page, including the handle (the part that you drag to scroll), track (the area where the handle moves), and corner (where the horizontal and vertical scrollbars meet).
